import Link from 'next/link'

export default () => (
    <div>
        <p>Hello</p>
        <Link href="/products">
            <a>Products</a>
        </Link>

        <style jsx global>{`
          * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
          }
          body {
            font-family: 'Benton Sans', 'Helvetica Neue';
          }
          h2 {
            font-style: italic;
            color: #373fff;
          }
        `}</style>
    </div>
)
